import React from 'react'
import styled from 'styled-components'
import { AppContext } from '../App/AppProvider'

const ConfirmButton = styled.div`
    margin: 20px;
    color: green;
`

export default function () {

    return(
        <AppContext.Consumer> {
        ({setFavourites, favourites}) => <ConfirmButton onClick={setFavourites("bobobobob")}>Bob <span>{favourites}</span></ConfirmButton>
            }
        </AppContext.Consumer>
    )
}
